column386:
Project Apollo Freight Forwarding Application Suite : I played a pivotal role in the development of an extensive application suite tailored for the esteemed multinational Shipping and Logistics corporation, "Transworld Group," headquartered in Jebel Ali Dubai, UAE; This comprehensive suite catered to the diverse needs of freight forwarding operations and encompassed essential modules such as quote, bookings, Job Management, Accounts Receivables, Accounts Payables, and Master Data Management; Throughout the project lifecycle, spanning from conception to production rollout, I was deeply involved in every phase;
In particular, my responsibilities included the design and implementation of numerous user interface screens using Oracle Forms; These screens facilitated the seamless management of Full Container Load (FCL), Less than Container Load (LCL), air freight, clearance, and transport shipments, ensuring a user-friendly experience for the application's end-users;
Moreover, I leveraged my expertise in PL/SQL to develop a multitude of packages comprising functions and procedures that served as the backbone of the application; These meticulously crafted components were instrumental in ensuring the efficiency, reliability, and performance of critical backend processes;
Additionally, I actively participated in user training sessions as part of the User Acceptance Testing (UAT) phase and the subsequent production rollout; Through these sessions, I equipped end-users with the knowledge and skills necessary to effectively utilize the application, thereby contributing to its successful adoption and implementation;
My contributions to the Freight Forwarding Application Suite underscore my proficiency in software development methodologies, technical expertise in Oracle Forms, PL/SQL, Crystal Reports, Oracle Apex and dedication to delivering high-quality solutions that meet the evolving needs of clients in the shipping and logistics industry.
Project OEL Feeder Application Suite: As a key contributor, I played a pivotal role in the development and implementation of an Application Suite for Orient Express Lines (OEL) and Shreyas Shipping Limited, prominent Feeder operators with extensive operations in the Asia Pacific and Gulf regions; This comprehensive suite addressed the diverse operational needs of feeding operations and included essential modules such as Voyage Management, Bookings, TDR Management, Customer Tariff, Accounts Receivables, Accounts Payables, and Master Data Management;
Throughout the project lifecycle, from conception to production rollout, I was deeply involved in every phase; My responsibilities encompassed the design and implementation of numerous user interface screens using Oracle Forms; These screens facilitated seamless management of critical processes including Customer bookings, Vessel Schedule, Loadings, and Bunker Management, ensuring an intuitive and user-friendly experience for the application's end-users;
Moreover, leveraging my expertise in PL/SQL, I developed a multitude of packages comprising functions and procedures that formed the backbone of the application; These meticulously crafted components were instrumental in ensuring the efficiency, reliability, and performance of crucial backend processes, thereby contributing significantly to the overall robustness of the application;
Additionally, I actively participated in user training sessions during the User Acceptance Testing (UAT) phase and subsequent production rollout; Through these sessions, I played a key role in equipping end-users with the requisite knowledge and skills to effectively utilize the application, thereby facilitating its successful adoption and implementation;
Furthermore, I contributed to the project's success by developing numerous business-critical reports using Crystal Reports and Oracle APEX; These reports provided valuable insights into various aspects of feeding operations, empowering stakeholders to make informed decisions and optimize business processes effectively.

Project KG WMS: As the lead developer, I spearheaded the development and implementation of a comprehensive Warehouse Management System (WMS) for KG International FZCO, a prominent trading company headquartered in Jebel Ali, Dubai, UAE; The warehouse, spanning approximately 30,000 square meters with 6 loading/unloading bays, was divided into three major areas: receiving, build storage, and a double-deep 7-level high racking system;
The Warehouse Inbound modules included advanced features such as Advance Shipment Notice, Goods Receipt Note, and putaway functionalities; For Outbound operations, the system seamlessly integrated with Sales Order processing, Picklist generation, and delivery management;
Furthermore, I played a crucial role in developing multiple key reports using Crystal Reports and Oracle APEX, which served as the backbone of export documentation; These reports included essential documents such as packing lists, proforma invoices, and shipping instructions;
In addition to the main WMS, I also developed a mini extension using VB;NET for floor operations; This extension, designed to be deployed on Windows-based handheld devices, facilitated seamless integration of floor work line tasks such as binning, putaway, picking, and stock cycle counting directly into the main WMS; This mini extension significantly reduced manual data entry work, thereby enhancing operational efficiency;
Moreover, within the WMS, I developed modules capable of generating barcodes for all items, further streamlining inventory management processes and ensuring accuracy throughout warehouse operations.

column382:
For a workforce monitoring platform called Productiviti, I developed APIs for a variety of time-series reports: Work Metrics, App Usage, and Machine Usage; these reports display the pertinent information on different timescales (hourly, daily, weekly, monthly, or yearly scale); they entailed operations on timestamps and a bunch of groupings and accumulations (summing up the work logs, averaging the RAM and space usage, etc.), which was majorly accomplished using MongoDB's Aggregation Pipelines;
I developed APIs for individual reports as well as collective reports for different operational levels (business level, domain level, project level, or team level); the collective reports include Collective Work Metrics, Collective App Usage, Business Assets, and censuses such as RAM census, space census, and OS census; Apart from the time-series reports, I contributed to the development of attendance APIs: Individual Attendance and Collective Attendance.

I did a MuleSoft project that provides integration between SAP and Salesforce; it was for a power company in the Philippines; I implemented a principal flow branching out into heterogeneous sub-flows that hinge on the value of an argument, called the "event"; each sub-flow has its disparate processing logic leading to the updation of the appertained Salesforce object; the validations, transformations, and mappings are implemented in a blend of Java and DataWeave (the programming language used in MuleSoft); I implemented unit test cases (called MUnit test cases), error handling, logs creation and a lot more.
